function Complain() {
  return (
    <>
      <center>
        {/* <div style={{backgroundImage:`url(${image})`}} >  */}
        <div className="length">
          <div className="myTable">
            <div className="form-group">
              <table>
                <tr aria-colspan={2}>
                  <td className="fa">Enter OrderId</td>
                  <td>
                    <input
                      type="number"
                      required
                      className="form-control"
                      // value={orderId}
                      disabled
                      placeholder="Enter OrderId"
                      //   onChange={(e) => {
                      //     setProfile({ ...profile, OrderId: e.target.value });
                      //   }}
                    />
                  </td>
                </tr>
                <tr className="tr"></tr>

                <tr>
                  <td className="td"></td>
                  <td className="fa">Mention Issues</td>
                  <td>
                    <select
                      name="role"
                      //   onChange={(e) => {
                      //     setProfile({ ...profile, gender: e.target.value });
                      //   }}
                    >
                      <option value="Select Issue">Select Role</option>
                      <option value="productDamage">productDamage</option>
                      <option value="productDamage">deliveredLate</option>
                    </select>
                  </td>
                </tr>
              </table>
            </div>
            <tr className="tr"></tr>

            <tr>
              <td className="fa">Enter Password</td>
              <td>
                <input
                  type="text"
                  required
                  className="form-control"
                  value=""
                  placeholder="Enter Description"
                  //   onChange={(e) => {
                  //     setProfile({ ...profile, description: e.target.value });
                  //   }}
                />
              </td>
            </tr>

            <hr></hr>

            <button className="btn btn-primary">Submit Complain</button>
          </div>
        </div>
      </center>
    </>
  );
}

export default Complain;
